import React from 'react';
import { useNavigate } from 'react-router-dom';
import logo from '../assets/logo.png';
import '../styles.css';  // Assurez-vous d'importer les styles

function Interface5() {
  const navigate = useNavigate();

  const handleBackClick = () => {
    navigate('/Interface4'); // Revenir à la page précédente
  };

  const goToInterface6 = () => {
    navigate('/Interface6');  // Navigue vers l'interface 6
  };

  return (
    <div className="main-content">
      <div className="header">
        <NavBar />
      </div>
      <div className="survey-content">
        <div className="back-link" onClick={handleBackClick}>&lt;Back</div>
        <h2 className="survey-title">À quelle fréquence votre famille joue-t-elle à des jeux vidéo en ligne?</h2>
        <p className="survey-description">(Call of Duty, Battlefield, World of Warcraft, League of Legends, etc.)</p>
        <div className="survey-options">
          <button className="survey-btn" onClick={goToInterface6}>Rarement</button>
          <button className="survey-btn" onClick={goToInterface6}>Hebdomadairement</button>
          <button className="survey-btn" onClick={goToInterface6}>Tous les jours</button>
        </div>
      </div>
    </div>
  );
}

function NavBar() {
  return (
    <div className="navbar">
      <img src={logo} alt="Topnet Logo" className="logo" />
      <ProgressBar progress={60} />
      <SpeedDisplay speed={20} />
    </div>
  );
}

function ProgressBar({ progress }) {
  return (
    <div className="progress-bar-container">
      <div className="progress-bar" style={{ width: `${progress}%` }}></div>
      <span className="progress-text">{`${progress}%`}</span>
    </div>
  );
}

function SpeedDisplay({ speed }) {
  return (
    <div className="speed-display-container">
      <div className="speed-text">
        Vitesse Minimum <br />
        Recommandée
      </div>
      <div className="speed-value">{speed} <span className="speed-unit">Mbps</span></div>
    </div>
  );
}

export default Interface5;
